import React from "react";
import '../styles/RegistrationPage.css'
import NameAndInput from "./components/NameAndInput";

const Registration = () => {
    return (
        <div className="RegistrationPage">
          <div className="RegistrationHeader">
            <p>
              Регистрация
            </p>         
          </div>
          <div className="MainWindowRegistration">
            <NameAndInput title="Enter your Name"/>
            <NameAndInput title="Enter your User Name"/>
            <NameAndInput title="Enter your Email"/>
            <NameAndInput title="Enter your Password"/>
            <button variant="success">Accept</button>
          </div>
        </div>
      );
}

export default Registration;
